O SCA Aluno é um aplicativo disponibilizado para todos os alunos das academias que utilizam o Sistema SCA Online, com as seguintes funcionalidades:

- Informações cadastrais;
- Histórico de pagamentos de mensalidades, planos e matrículas;
- Ficha de treino com animações;
- Calendário de frequência;
- Produtos da academia e suas compras.

Sistema SCA Online. Simples, Completo e Acessível!

O SCA Fit é um aplicativo completo e exclusivo para alunos de academias, clubes e studios que utilizam o Sistema SCA.

Dentro do aplicativo, você consegue ter o controle total do seu treino de maneira dinâmica e funcional, obtendo uma experiência completa na palma da sua mão mesmo quando estiver sem internet. É possível interagir com a sua academia através da central de contato, acompanhar as novidades por meio dos avisos e publicidades. Confira outras funções do aplicativo:

- Consulta das informações cadastrais;
- Histórico dos pagamentos de mensalidades;
- Visualizar horários de acesso;
- Ficha de treino interativa com animações, definição de carga, cronômetro e tempo de execução;
- Visualize e compare as avaliações físicas;
- Acesso por QRCode;
- Aplicativo Online e Offline;
- Histórico de matrículas.

Sistema SCA. Simples, prático e rápido!
